public void testHashCodeEquals() {
  OpenBitSet bs1 = new OpenBitSet(200);
  OpenBitSet bs2 = new OpenBitSet(64);
  bs1.set(3);
  bs2.set(3);       
  assertEquals(bs1, bs2);
  assertEquals(bs1.hashCode(), bs2.hashCode());
}

